import React from "react";
import "./trainning.css";
import MuseumIcon from "@mui/icons-material/Museum";
import LocalPharmacyIcon from "@mui/icons-material/LocalPharmacy";
import FlightTakeoffIcon from "@mui/icons-material/FlightTakeoff";
import LegendToggleIcon from "@mui/icons-material/LegendToggle";
import TbHealthRecognition from "react-icons/tb";
function Trainning() {
  return (
    <div className="content-container">
      <h1>Title of trainnings</h1>
      <div className="trainningContent-container">
        <div className="leftTrainningContent">
          <div className="title">
            <h1>Come and be Trained in </h1>
            <div className="content">
              <div>
                <span>
                  <FlightTakeoffIcon className="trainingIcon" />
                </span>{" "}
                Aviation Management/IATA/ICAO
              </div>
              <div>
                <span>
                  <LegendToggleIcon className="trainingIcon" />
                </span>{" "}
                Monitoring & Evaluation/ ICT
              </div>
              <div>
                <span>
                  <TbHealthRecognition className="trainingIcon" />
                </span>{" "}
                Hospitality
              </div>
              <div>
                <span>
                  <MuseumIcon className="trainingIcon" />
                </span>{" "}
                Tourism
              </div>
            </div>
          </div>
        </div>
        <div className="rightContentContainer">
          <div className="title">
            <h1>Other Services</h1>
            <div className="content2">
              <div>
                <span>
                  <MuseumIcon className="trainingIcon" />
                </span>{" "}
                Air ticket booking
              </div>
              <div>
                <span>
                  <MuseumIcon className="trainingIcon" />
                </span>{" "}
                Visa assistance
              </div>
              <div>
                <span>
                  <MuseumIcon className="trainingIcon" />
                </span>{" "}
                Tour package
              </div>
              <div>
                <span>
                  <MuseumIcon className="trainingIcon" />
                </span>{" "}
                Consultancy
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Trainning;
